import {
  AnchorType,
  Camera2D,
  createLayer,
  InstanceProvider,
  LabelInstance,
  LabelLayer,
  LayerInitializer,
  ReferenceCamera2D,
} from '../../../../src';
import { BaseExample, TestResourceKeys } from './base-example';

export class LabelSizingCorrected extends BaseExample {
  makeLayer(
    resource: TestResourceKeys,
    provider: InstanceProvider<LabelInstance>
  ): LayerInitializer {
    return createLayer(LabelLayer, {
      resourceKey: resource.font,
      data: provider,
      key: 'label-sizing-corrected',
    });
  }

  makeCamera(defaultCamera: Camera2D): Camera2D {
    return new ReferenceCamera2D({
      base: defaultCamera,
      scaleFilter: (scale: [number, number, number]) => [scale[0], scale[1], 1],
    });
  }

  makeProvider(): InstanceProvider<LabelInstance> {
    const provider = new InstanceProvider<LabelInstance>();

    provider.add(
      new LabelInstance({
        anchor: {
          padding: 0,
          type: AnchorType.Middle,
        },
        color: [1.0, 1.0, 1.0, 1.0],
        fontSize: 18,
        id: `label-compare-0`,
        scale: 0.5,
        text: '0.5',
        origin: [20, 40],
      })
    );

    provider.add(
      new LabelInstance({
        anchor: {
          padding: 0,
          type: AnchorType.Middle,
        },
        color: [1.0, 1.0, 1.0, 1.0],
        fontSize: 18,
        id: `label-compare-1`,
        scale: 1.0,
        text: '1.0',
        origin: [50, 40],
      })
    );

    provider.add(
      new LabelInstance({
        anchor: {
          padding: 0,
          type: AnchorType.Middle,
        },
        color: [1.0, 1.0, 1.0, 1.0],
        fontSize: 18,
        id: `label-compare-2`,
        scale: 2.0,
        text: '2.0',
        origin: [80, 40],
      })
    );

    provider.add(
      new LabelInstance({
        anchor: {
          padding: 0,
          type: AnchorType.Middle,
        },
        color: [1.0, 1.0, 1.0, 1.0],
        fontSize: 18,
        id: `label-compare-2`,
        maxScale: 2.0,
        scale: 0.5,
        text: '0.5 max 2.0',
        origin: [20, 80],
      })
    );

    return provider;
  }
}
